import React from 'react';
import './scss/FileName.scss';
import { Container, Row, Col } from 'react-grid-system';

function App() {
  return (
    <Container>
      <div className="App">
        <header className='header'>
          <a href='/' className='header_logo'></a>
        </header>

        <Row>
          <Col sm={4} md={5} ><div>Pipa</div></Col>
        </Row>

      </div>
    </Container>
  );
}

export default App;
